import React from "react";
import { Link } from "react-router-dom";

const SideMeniu = () => {
  return (
    <div className="side_meniu">
      <Link to="/contact">Posts</Link>
      <Link to="/galery">Galery</Link>
      <Link to="/profile">Profile</Link>
    </div>
  );
};

export default SideMeniu;
